import React from 'react';
import circleStyle from "../css/circle.css";
function Project() {
    return (
    <div  className="Project">
        <h1 style={{
        position: "absolute",
        width: "100px",
        height: "34px",
        left: "35px",
        top: "90px",
        fontFamily: 'Noto Sans',
        fontStyle: "normal",
        fontWeight: "600",
        fontSize: "25px",
        lineHeight: "34px",
        color: "#000000"}}>프로젝트</h1>
        <div className={circleStyle.circle}>
            
        </div>
    </div>
        
        
    );
}

export default Project
